import React, { useEffect, useState } from 'react';

function ResetPassword(props) {
	const [password, setPassword] = useState('');
	return (
		<>
			<div className="container">
				<div className="row">
					<div className="col-md-6">
						<div className="passcontainer">
							<h4 className="">Reset your password</h4>
							<p className="">Change your password</p>

							<form className="">
								<div className="form-group">
									<label htmlFor="exampleInputPassword1">Password</label>
									<input type="text" className="form-control" id="exampleInputPhone" placeholder="input your new password" onChange={(e) => setPassword(e.target.value)} required />
								</div>
							</form>
						</div>
					</div>
					<div className="col-md-6">
						<img src="/forgot-password-login-illustration.jpg" alt="picture" className="Image" />
					</div>
				</div>
			</div>
		</>
	);
}

export default ResetPassword;
